import React from "react";
import ItemServicio from './ItemServicio';
function Servicios(){
    const Items = ["Apoyo escolar a estudiantes con discapacidad itelectual-motriz",
                    "Apoyo escolar con dificultades específicas del apredizaje",
                    "Acompañamiento en la trayectoria educativa y extraescolar",
                    "Acompañamiento y asesoramiento a las familias"]
    return (
        <section className="seccion-servicios">
            <div className="row">
                {Items.map((item)=>{
                    <ItemServicio>{item}</ItemServicio>
                })}
            </div>
        </section>
    );
}
export default Servicios;
